import React from "react";

export default function Siedbar() {
  return (
    <>
      <div className="sliedbar">
        <div className="slied-icon">
          <button className="btn-slied">
            <i class="fa-solid fa-house fa-2xl"></i>
          </button>
        </div><br />
        <div className="slied-icon-2">
          <button className="btn-slied">
            <i class="fa-brands fa-product-hunt fa-2xl"></i>
          </button>
        </div>
      </div>
    </>
  );
}
